INSERT INTO `movie` VALUES ('2001: A Space Odyssey','Humanity finds a mysterious, obviously artificial, object buried beneath the Lunar surface and, with the intelligent computer H.A.L. 9000, sets off on a quest.',8.4,248),('A Beautiful Mind','After a brilliant but asocial mathematician accepts secret work in cryptography, his life takes a turn to the nightmarish.',8.1,300),('A Clockwork Orange','In future Britain, charismatic delinquent Alex DeLarge is jailed and volunteers for an experimental aversion therapy developed by the government in an effort to solve society\'s crime problem... but not all goes to plan.',8.5,321),('A Fistful of Dollars','A wandering gunfighter plays two rival families against each other in a town torn apart by greed, pride, and revenge.',8,71),('Alien','The crew of a commercial deep space mining ship, investigating a suspected S.O.S., lands on a distant planet and discovers a nest of strange eggs.',8.5,322),('Aliens','The planet from \'Alien\' has been colonized, but contact is lost. This time, the rescue team has impressive firepower, but will it be enough?',8.5,292),('Amlie','Amelie, an innocent and naive girl in Paris, with her own sense of justice, decides to help those around her and along the way, discovers love.',8.5,318),('American Beauty','Lester Burnham, a depressed suburban father in a mid-life crisis, decides to turn his hectic life around after developing an infatuation for his daughter\'s attractive friend.',8.5,500),('American History X','A former neo-nazi skinhead tries to prevent his younger brother from going down the same wrong path that he did.',8.6,439),('Apocalypse Now','During the U.S.-Viet Nam War, Captain Willard is sent on a dangerous mission into Cambodia to assassinate a renegade colonel who has set himself up as a god among a local tribe.',8.6,279),('Back to the Future','A teenager is accidentally sent 30 years into the past in a time-traveling DeLorean invented by his friend, Dr. Emmett Brown, and must make sure his high-school-age parents unite in order to save his own existence.',8.5,384),('Batman Begins','After training with his mentor, Batman begins his war on crime to free the crime-ridden Gotham City from corruption that the Scarecrow and the League of Shadows have cast upon it.',8.3,546),('Black Swan','A ballet dancer wins the lead in \'Swan Lake\' and is perfect for the role of the delicate White Swan - Princess Odette - but slowly loses her mind as she becomes more and more like Odile, the Black Swan.',8.1,330),('Blade Runner','Deckard, a blade runner, has to track down and terminate 4 replicants who hijacked a ship in space and have returned to Earth seeking their maker.',8.3,296),('Braveheart','When his secret bride is executed for assaulting an English soldier whom tried to rape her, a commoner begins a revolt and leads Scottish warriors against the cruel English tyrant who rules Scotland with an iron-fist.',8.4,432),('Butch Cassidy and the Sundance Kid','Two Western bank/train robbers flee to Bolivia when the law gets too close.',8.2,92),('Cinema Paradiso','A filmmaker recalls his childhood, when he fell in love with the movies at his village\'s theater and formed a deep friendship with the theater\'s projectionist.',8.4,82),('Citizen Kane','Following the death of a publishing tycoon, news reporters scramble to discover the meaning of his final utterance.',8.5,198),('City Lights','The Tramp struggles to help a blind flower girl he has fallen in love with.',8.6,55),('City of God','Two boys growing up in a violent neighborhood of Rio de Janeiro take different paths: one becomes a photographer, the other a drug dealer.',8.7,312),('Die Hard','John McClane, officer of the NYPD, tries to save wife Holly Gennaro and several others, taken hostage by German terrorist Hans Gruber during a Christmas party at the Nakatomi Plaza in Los Angeles.',8.3,353),('District 9','An extraterrestrial race forced to live in slum-like conditions on Earth suddenly finds a kindred spirit in a government agent who is exposed to their biotechnology.',8,337),('Django Unchained','With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.',8.6,302),('Donnie Darko','A troubled teenager is plagued by visions of a large bunny rabbit that manipulates him to commit a series of crimes, after narrowly escaping a bizarre accident.',8.1,361),('Dr. Strangelove or: How I Learned to Stop Worrying','An insane general starts a process to nuclear holocaust that a war room of politicians and generals frantically try to stop.',8.6,228),('Eternal Sunshine of the Spotless Mind','A couple undergo a procedure to erase each other from their memories when their relationship turns sour, but it is only through the process of loss that they discover what they had to begin with.',8.4,397),('Fight Club','An insomniac office worker looking for a way to change his life crosses paths with a devil-may-care soap maker and they form an underground fight club that evolves into something much, much more...',8.9,727),('Finding Nemo','After his son is captured in the Great Barrier Reef and taken to Sydney, a timid clownfish sets out on a journey to bring him home.',8.1,356),('For a Few Dollars More','Two bounty hunters with the same intentions, team up to track down a Western outlaw.',8.3,84),('Forrest Gump','Forrest Gump, while not intelligent, has accidentally been present at many historic moments, but his true love, Jenny Curran, eludes him.',8.7,631),('Full Metal Jacket','A pragmatic U.S. Marine observes the dehumanizing effects the Vietnam War has on his fellow Marine recruits from their brutal boot camp training to the bloody street fighting set in 1968 in Hue, Vietnam.',8.4,273),('Gandhi','Biography of Mohandas K. Gandhi, the lawyer who became the famed leader of the Indian revolts against the British rule through his philosophy of non-violent protest.',8.1,97),('Gladiator','When a Roman general is betrayed and his family murdered by an emperor\'s corrupt son, he comes to Rome as a gladiator to seek revenge.',8.5,534),('Goodfellas','Henry Hill and his friends work their way up through the mob hierarchy.',8.8,415),('Gran Torino','Disgruntled Korean War vet Walt Kowalski sets out to reform his neighbor, a young Hmong teenager, who tried to steal Kowalski\'s prized possession: his 1972 Gran Torino.',8.2,325),('Grave of the Fireflies','A tragic film covering a young boy and his little sister\'s struggle to survive in Japan during World War II.',8.4,66),('Harry Potter and the Deathly Hallows: Part 2','Harry, Ron and Hermione search for Voldemort\'s remaining Horcruxes in their effort to destroy the Dark Lord.',8.1,265),('Hotel Rwanda','The true-life story of Paul Rusesabagina, a hotel manager who housed over a thousand Tutsi refugees during their struggle against the Hutu militia in Rwanda.',8.2,163),('How to Train Your Dragon','A hapless young Viking who aspires to hunt dragons becomes the unlikely friend of a young dragon himself, and learns there may be more to the creatures than he assumed.',8.2,210),('Inception','A skilled extractor is offered a chance to regain his old life as payment for a task considered to be impossible.',8.8,748),('Indiana Jones and the Last Crusade','When Dr. Henry Jones Sr. suddenly goes missing while pursuing the Holy Grail, eminent archaeologist Indiana Jones must follow in his father\'s footsteps and stop the Nazis.',8.3,301),('Infernal Affairs','A story between a mole in the police department and an undercover cop. Their objectives are the same: to find out who is the mole, and who is the cop.',8.1,57),('Inglourious Basterds','In Nazi-occupied France during World War II, a plan to assassinate Nazi leaders by a group of Jewish U.S. soldiers coincides with a theatre owner\'s vengeful plans for the same.',8.3,446),('Into the Wild','After graduating from Emory University, top student and athlete Christopher McCandless abandons his possessions, gives his entire $24,000 savings account to charity and hitchhikes to Alaska to live in the wilderness. Along the way, Christopher encounters a series of characters that shape his life.',8.2,231),('Ip Man','A semi-biographical account of Yip Man, the first martial arts master to teach the Chinese martial art of Wing Chun.',8.1,71),('Jaws','When a gigantic great white shark begins to menace the small island community of Amity, a police chief, a marine scientist and grizzled fisherman set out to stop it.',8.2,238),('Jurassic Park','During a preview tour, a theme park suffers a major power breakdown that allows its cloned dinosaur exhibits to run amok.',8,297),('Kill Bill: Vol. 1','The Bride wakens from a four-year coma. The child she carried in her womb is gone. Now she must wreak vengeance on the team of assassins who betrayed her - a team she was once part of.',8.2,427),('L.A. Confidential','As corruption grows in 1950s LA, three policemen - the straight-laced, the brutal, and the sleazy - investigate a series of murders with their own brand of justice.',8.4,266),('Lon: The Professional','A professional assassin rescues a teenage girl whose parents were killed in a police raid.',8.6,404),('Life of Brian','Brian is born on the original Christmas, in the stable next door. He spends his life being mistaken for a messiah.',8.1,165),('Life of Pi','A young man who survives a disaster at sea is hurtled into an epic journey of adventure and discovery. While cast away, he forms an unexpected connection with another survivor: a fearsome Bengal tiger.',8.1,173),('Memento','A man, suffering from short-term memory loss, uses notes and tattoos to hunt for the man he thinks killed his wife.',8.6,503),('Metropolis','In a futuristic city sharply divided between the working class and the city planners, the son of the city\'s mastermind falls in love with a working class prophet who predicts the coming of a savior to mediate their differences.',8.4,67),('Million Dollar Baby','A determined woman works with a hardened boxing trainer to become a professional.',8.1,270),('Monsters, Inc.','Monsters generate their city\'s power by scaring children, but they are terribly afraid themselves of being contaminated by children, so when one enters Monstropolis, top scarer Sulley finds his world disrupted.',8,282),('Monty Python and the Holy Grail','King Arthur and his knights embark on a low-budget search for the Grail, encountering many very silly obstacles.',8.4,241),('My Neighbor Totoro','When two girls move to the country to be near their ailing mother, they have adventures with the wonderous forest spirits who live nearby.',8.2,75),('Mystic River','With a childhood tragedy that overshadowed their lives, three men are reunited by circumstance when one loses a daughter.',8,228),('No Country for Old Men','Violence and mayhem ensue after a hunter stumbles upon a drug deal gone wrong and more than two million dollars in cash near the Rio Grande.',8.2,357),('Once Upon a Time in America','A former Prohibition-era Jewish gangster returns to the Lower East Side of Manhattan over thirty years later, where he once again must confront the ghosts and regrets of his old life.',8.4,130),('One Flew Over the Cuckoo\'s Nest','Upon admittance to a mental institution, a brash rebel rallies the patients to take on the oppressive head nurse, a woman he views as more dictator than nurse.',8.8,402),('Pan\'s Labyrinth','In the fascist Spain of 1944, the bookish young stepdaughter of a sadistic army officer escapes into an eerie but captivating fantasy world.',8.3,280),('Pirates of the Caribbean: The Curse of the Black P','Blacksmith Will Turner teams up with eccentric pirate \'Captain\' Jack Sparrow to save his love, the governor\'s daughter, from Jack\'s former pirate allies, who are now undead.',8,462),('Platoon','A young recruit in Vietnam faces a moral crisis when confronted with the horrors of war and the duality of man.',8.2,182),('Princess Mononoke','On a journey to find the cure for a Tatarigami\'s curse, Ashitaka finds himself in the middle of a war between the forest gods and Tatara, a mining colony. In this quest he also meets San, the Mononoke Hime.',8.4,120),('Psycho','A thirty-something secretary steals $40,000 from her employer\'s client, and subsequently encounters a young motel proprietor too long under the domination of his mother.',8.6,242),('Pulp Fiction','The lives of two mob hit men, a boxer, a gangster\'s wife, and a pair of diner bandits intertwine in four tales of violence and redemption.',9,740),('Raiders of the Lost Ark','Archeologist and adventurer Indiana Jones is hired by the US government to find the Ark of the Covenant before the Nazis.',8.7,400),('Ran','An elderly lord abdicates to his three sons, and the two corrupt ones turn against him.',8.3,50),('Rashomon','A heinous crime and its aftermath are recalled from differing points of view.',8.4,62),('Ratatouille','With dreams of becoming a chef, a culinary genius in the form of a rat, makes an unusual alliance with a young kitchen worker at a famed restaurant.',8,278),('Requiem for a Dream','The drug-induced utopias of four Coney Island individuals are shattered when their addictions become stronger.',8.4,339),('Reservoir Dogs','After a simple jewelery heist goes terribly wrong, the surviving criminals begin to suspect that one of them is a police informant.',8.4,374),('Rocky','A small time boxer gets a once in a lifetime chance to fight the heavyweight champ in a bout in which he strives to go the distance for his self-respect.',8.1,197),('Saving Private Ryan','Following the Normandy Landings, a group of U.S. soldiers go behind enemy lines to retrieve a paratrooper whose brothers have been killed in action.',8.6,491),('Scarface','In 1980 Miami, a determined Cuban immigrant takes over a drug cartel while succumbing to greed.',8.3,305),('Schindler\'s List','In Poland during World War II, Oskar Schindler gradually becomes concerned for his Jewish workforce after witnessing their persecution by the Nazis.',8.9,488),('Se7en','Two detectives, a rookie and a veteran, hunt a serial killer who uses the seven deadly sins as his modus operandi.',8.7,558),('Seven Samurai','A poor village under attack by bandits recruits seven unemployed samurai to help them defend themselves.',8.8,148),('Shutter Island','Drama set in 1954, U.S. Marshal Teddy Daniels is investigating the disappearance of a murderess who escaped from a hospital for the criminally insane and is presumed to be hiding nearby.',8,375),('Sin City','A film that explores the dark and miserable town, Basin City, and tells the story of three different people, all caught up in violent corruption.',8.2,422),('Slumdog Millionaire','A Mumbai teen who grew up in the slums, becomes a contestant on the Indian version of \'Who Wants To Be A Millionaire?\' He is arrested under suspicion of cheating, and while being interrogated, events from his life history are shown which explain why he knows the answers.',8.1,381),('Snatch','Unscrupulous boxing promoters, violent bookmakers, a Russian gangster, incompetent amateur robbers, and supposedly Jewish jewelers fight to track down a priceless stolen diamond.',8.3,349),('Spirited Away','In the middle of her family\'s move to the suburbs, a sullen 10-year-old girl wanders into a world ruled by gods, witches, and monsters; where humans are changed into animals; and a bathhouse for these creatures.',8.6,213),('Stand by Me','After the death of a friend, a writer recounts a boyhood journey to find the body of a missing boy.',8.1,162),('Star Trek','The brash James T. Kirk tries to live up to his father\'s legacy with Mr. Spock keeping him in check as a vengeful, time-traveling Romulan creates black holes to destroy the Federation one planet at a time.',8,296),('Star Wars','Luke Skywalker, a spirited farm boy, joins rebel forces to save Princess Leia from the evil Darth Vader, and the galaxy from the Empire\'s planet-destroying Death Star.',8.8,525),('Star Wars: Episode V - The Empire Strikes Back','As Luke trains with Master Yoda to become a Jedi Knight, his friends evade the Imperial fleet under the command of Darth Vader who is obsessed with turning Skywalker to the Dark Side of the Force.',8.8,469),('Star Wars: Episode VI - Return of the Jedi','After rescuing Han Solo from the palace of Jabba the Hutt, the Rebels attempt to destroy the Second Death Star, while Luke Skywalker tries to bring his father back to the Light Side of the Force.',8.4,367),('Taxi Driver','A mentally unstable Vietnam war veteran works as a nighttime taxi driver in New York City where the perceived decadence and sleaze feeds his urge to violently lash out, attempting to save a teenage prostitute in the process.',8.5,288),('Terminator 2: Judgment Day','The cyborg who once tried to kill Sarah Connor is dead, and another T-101 must now protect her teenage son, John Connor, from an even more powerful and advanced Terminator, the T-1000.',8.6,429),('The Avengers','Nick Fury of S.H.I.E.L.D. brings together a team of super humans to form The Avengers to help save the Earth from Loki and his army.',8.3,490),('The Big Lebowski','\'Dude\' Lebowski, mistaken for a millionaire Lebowski, seeks restitution for his ruined rug and enlists his bowling buddies to help get it.',8.2,312),('The Bourne Ultimatum','Jason Bourne dodges a ruthless CIA official and his agents from a new assassination program while searching for the origins of his life as a trained killer.',8.1,291),('The Dark Knight','When Batman, Gordon and Harvey Dent launch an assault on the mob, they let the clown out of the box, the Joker, bent on turning Gotham on itself and bringing any heroes down to his level.',9,930),('The Dark Knight Rises','Eight years on, a new evil rises from where the Batman and Commissioner Gordon tried to bury it, causing the Batman to resurface and fight to protect Gotham City... the very city which brands him an enemy.',8.6,586),('The Deer Hunter','An in-depth examination of the way that the Vietnam war affects the lives of people in a small industrial town in the USA.',8.2,147),('The Departed','An undercover state cop who infiltrated a Mafia clan and a mole in the police force working for the same mob race to track down and identify each other before being exposed to the enemy, after both sides realize their outfit has a rat.',8.5,482),('The Exorcist','When a teenage girl is possessed by a mysterious entity, her mother seeks the help of two priests to save her daughter.',8,190),('The Godfather','The aging patriarch of an organized crime dynasty transfers control of his clandestine empire to his reluctant son.',9.2,680),('The Godfather: Part II','The early life and career of Vito Corleone in 1920s New York is portrayed while his son, Michael, expands and tightens his grip on his crime syndicate stretching from Lake Tahoe, Nevada to pre-revolution 1958 Cuba.',9.1,438),('The Good, the Bad and the Ugly','A bounty hunting scam joins two men in an uneasy alliance against a third in a race to find a fortune in gold buried in a remote cemetery.',9,289),('The Great Dictator','Dictator Adenoid Hynkel has a doppelganger, a poor but kind Jewish barber living in the slums, who one day is mistaken for Hynkel.',8.5,69),('The Green Mile','The lives of guards on Death Row are affected by one of their charges: a black man accused of child murder and rape, yet who has a mysterious gift.',8.5,394),('The Hobbit: An Unexpected Journey','A younger and more reluctant Hobbit, Bilbo Baggins, sets out on an \'unexpected journey\' to the Lonely Mountain with a spirited group of Dwarves to reclaim their stolen mountain home from a dragon named Smaug.',8.2,289),('The Intouchables','After he becomes a quadriplegic from a paragliding accident, an aristocrat hires a young man from the projects to be his caretaker.',8.5,178),('The King\'s Speech','The story of King George VI of Britain, his impromptu ascension to the throne and the speech therapist who helped the unsure monarch become worthy of it.',8.1,254),('The Lion King','Tricked into thinking he killed his father, a guilt ridden lion cub flees into exile and abandons his identity as the future King.',8.4,316),('The Lord of the Rings: The Fellowship of the Ring','A meek hobbit of The Shire and eight companions set out on a journey to Mount Doom to destroy the One Ring and the dark lord Sauron.',8.8,704),('The Lord of the Rings: The Return of the King','Gandalf and Aragorn lead the World of Men against Sauron\'s army to draw his gaze from Frodo and Sam as they approach Mount Doom with the One Ring.',8.9,687),('The Lord of the Rings: The Two Towers','While Frodo and Sam edge closer to Mordor with the help of the shifty Gollum, the divided fellowship makes a stand against Sauron\'s new ally, Saruman, and his hordes of Isengard.',8.7,617),('The Matrix','A computer hacker learns from mysterious rebels about the true nature of his reality and his role in the war against its controllers.',8.7,694),('The Perks of Being a Wallflower','An introvert freshman is taken under the wings of two seniors who welcome him to the real world.',8.1,117),('The Pianist','A Polish Jewish musician struggles to survive the destruction of the Warsaw ghetto of World War II.',8.5,264),('The Prestige','The rivalry between two magicians is exacerbated when one of them performs the ultimate illusion.',8.4,438),('The Seventh Seal','A man seeks answers about life, death, and the existence of God as he plays chess against the Grim Reaper during the Black Plague.',8.3,66),('The Shawshank Redemption','Two imprisoned men bond over a number of years, finding solace and eventual redemption through acts of common decency.',9.3,956),('The Shining','A family heads to an isolated hotel for the winter where an evil and spiritual presence influences the father into violence, while his psychic son sees horrific forebodings from the past and of the future.',8.5,338),('The Silence of the Lambs','A young FBI cadet must confide in an incarcerated and manipulative killer to receive his help on catching another serial killer who skins his victims.',8.7,465),('The Sixth Sense','A boy who communicates with spirits that don\'t know they\'re dead seeks the help of a disheartened child psychologist.',8.2,427),('The Terminator','A robotic assassin from a post-apocalyptic future travels back in time to eliminate a waitress, whose son will grow up and lead humanity in a war against machines.',8.1,338),('The Truman Show','An insurance salesman/adjuster discovers his entire life is actually a TV show.',8,353),('The Untouchables','Federal Agent Eliot Ness sets out to stop Al Capone; because of rampant corruption, he assembles a small, hand-picked team.',8,148),('The Wizard of Oz','Dorothy Gale is swept away to a magical land in a tornado and embarks on a quest to see the Wizard who can help her return home.',8.2,171),('There Will Be Blood','A story about family, greed, religion, and oil, centered around a turn-of-the-century prospector in the early days of the business.',8.1,227),('To Kill a Mockingbird','Atticus Finch, a lawyer in the Depression-era South, defends a black man against an undeserved rape charge, and his kids against prejudice.',8.4,129),('Toy Story','A cowboy doll is profoundly threatened and jealous when a new spaceman figure supplants him as top toy in a boy\'s room.',8.3,323),('Toy Story 3','The toys are mistakenly delivered to a day-care center instead of the attic right before Andy leaves for college, and it\'s up to Woody to convince the other toys that they weren\'t abandoned and to return home.',8.5,284),('Trainspotting','Renton, deeply immersed in the Edinburgh drug scene, tries to clean up and get out, despite the allure of the drugs and influence of friends.',8.2,277),('Twelve Monkeys','In a future world devastated by disease, a convict is sent back in time to gather information about the man-made virus that wiped out most of the human population on the planet.',8.1,284),('Unforgiven','Retired Old West gunslinger William Munny reluctantly takes on one last job, with the help of his old partner and a young man.',8.3,171),('Up','By tying thousands of balloons to his home, 78-year-old Carl sets out to fulfill his lifelong dream to see the wilds of South America. Russell, a wilderness explorer 70 years younger, inadvertently becomes a stowaway.',8.3,324),('V for Vendetta','A shadowy freedom fighter known only as \'V\' uses terrorist tactics to fight against his totalitarian society. Upon rescuing a girl from the secret police, he also finds his best chance at having an ally.',8.2,451),('Vertigo','A retired San Francisco detective suffering from acrophobia investigates the strange activities of an old friend\'s much-younger wife, all the while becoming dangerously obsessed with her.',8.5,146),('WALLE','In the distant future, a small waste collecting robot inadvertently embarks on a space journey that will ultimately decide the fate of mankind.',8.5,381),('Warrior','The youngest son of an alcoholic former boxer returns home, where he\'s trained by his father for competition in a mixed martial arts tournament - a path that puts the fighter on a collision corner with his older brother.',8.2,163),('Yojimbo','A crafty ronin comes to a town divided by two criminal gangs and decides to play them against each other to free the town.',8.4,45);
